import React from 'react';
import ReactDOM from 'react-dom';
import App from './Pages/App/index';
import {AuthProvider} from './Providers/auth';

ReactDOM.render(
  <React.StrictMode>
    <AuthProvider>
       <App />
    </AuthProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
